  switch (a) {
  case CANCEL_REENCRYPT:
    return ReencryptAction.CANCEL;
  case START_REENCRYPT:
    return ReencryptAction.START;
  default:
    throw new IllegalArgumentException("Unexpected value: " + a);
  }
